svg.script:
function mD2Year(month, date){
    var lengths = [31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31];
    var ret = date;
    for (var i = 0; i < month; i ++){
        ret += lengths[i];
    }
    return ret;
}
function Easter(Y) { // THANKS, STACKOVERFLOW
  var C = Math.floor(Y/100);
  var N = Y - 19*Math.floor(Y/19);
  var K = Math.floor((C - 17)/25);
  var I = C - Math.floor(C/4) - Math.floor((C - K)/3) + 19*N + 15;
  I = I - 30*Math.floor((I/30));
  I = I - Math.floor(I/28)*(1 - Math.floor(I/28)*Math.floor(29/(I + 1))*Math.floor((21 - N)/11));
  var J = Y + Math.floor(Y/4) + I + 2 - C + Math.floor(C/4);
  J = J - 7*Math.floor(J/7);
  var L = I - J;
  var M = 3 + Math.floor((L + 40)/44);
  var D = L + 28 - 31*Math.floor(M/4);

  return [M, D];
}
function Thanksgiving(theyear) { // THANKS, ... freecodecamp? Seriously? Have I no taste in copy pasting?
    const lastOfNov = new Date(theyear, 10, 30).getDay();
    const turkyDay = (lastOfNov <= 4 ? 34 : 27) - lastOfNov;
    return turkyDay;
}

function addTranslation(element, x, y){
   element.setAttribute("transform", element.getAttribute("transform") + " translate(" + x + ", " + y + ")");
}

var pixelsPerYear = 40000;
var pixelsPerDay = pixelsPerYear/365;

var now = new Date(); // THANKS STACKOVERFLOW
var start = new Date(now.getFullYear(), 0, 0);
var diff = now - start;
var oneDay = 1000 * 60 * 60 * 24;
var dayOfYear = Math.floor(diff / oneDay);

var dayOff = dayOfYear/365 * pixelsPerYear;

var newyears = 0;
var valentines = mD2Year(1, 14);
var _easter = Easter(new Date().getFullYear());
var easter = mD2Year(_easter[0] - 1, _easter[1]);
var independence = mD2Year(6, 4);
var halloween = mD2Year(9, 31);
var thanksgiving = mD2Year(10, Thanksgiving(new Date().getFullYear()));
var christmas = mD2Year(11, 25);

var newyearsElem = document.getElementById("g2810");
var valentinesElem = document.getElementById("g2821");
var easterElem = document.getElementById("g2853");
var independenceElem = document.getElementById("g2989");
var halloweenElem = document.getElementById("g146441");
var thanksgivingElem = document.getElementById("g3018");
var christmasElem = document.getElementById("g3070");

addTranslation(newyearsElem, newyears * pixelsPerDay - dayOff, 0);
addTranslation(valentinesElem, valentines * pixelsPerDay - dayOff, 0);
addTranslation(easterElem, easter * pixelsPerDay - dayOff, 0);
addTranslation(independenceElem, independence * pixelsPerDay - dayOff, 0);
addTranslation(halloweenElem, halloween * pixelsPerDay - dayOff, 0);
addTranslation(thanksgivingElem, thanksgiving * pixelsPerDay - dayOff, 0);
addTranslation(christmasElem, christmas * pixelsPerDay - dayOff, 0);
